import React, { Component } from 'react'

export default class Button extends Component {
    changeToCelsuis = (temperature) => {
       return (temperature - 32) * 5/9
    }
    render() {
    return (
      <div>
        <button onClick={() => this.changeToCelsuis(this.props.temperature)}>Convert</button>
      </div>
    )
  }
}
